import styled from "styled-components";
import arrow from "../../images/arrow.svg";

const Container = styled.div`
  width: 100%;
  margin-top: 20px;
  border: 1px solid #3d3d3d;
`;

const InfoDiv = styled.div`
  width: 100%;
  padding: 20px 0;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`;

const Info = styled.div`
  width: 100px;
  flex-grow: 1;
`;

const Button = styled.div`
  width: 80px;
  flex-grow: 0;
  display: flex;
  align-items: center;
`;

const ButtonImg = styled.img`
  width: 15px;
  height: auto;
`;

const DetailDiv = styled.div`
  width: 100%;
  padding: 20px 50px;
  border-top: 1px solid grey;
  display: flex;
  flex-direction: column;
  box-sizing: border-box;
`;

const Introduction = styled.div`
  width: 100%;
  display: flex;
  flex-direction: column;
  text-align: left;
  padding: 15px 0;
`;

const DetailContainer = styled.div`
  display: grid;
  grid-template-columns: repeat(4, 1fr);
`;

const Detail = styled.div`
  width: 100%;
  display: flex;
  flex-direction: column;
  text-align: left;
  padding: 15px 0;
`;

const Title = styled.div`
  font-size: 18px;
  line-height: 24px;
  font-weight: bold;
`;

const Text = styled.div`
  font-size: 12px;
  line-height: 18px;
`;

const Product = () => {
  return (
    <Container>
      <InfoDiv>
        <Info>123</Info>
        <Info>123</Info>
        <Info>123</Info>
        <Info>123</Info>
        <Info>123</Info>
        <Button>
          <ButtonImg src={arrow} />
        </Button>
      </InfoDiv>
      <DetailDiv>
        <Introduction>
          <Title>Introduction</Title>
          <Text>Hello World</Text>
        </Introduction>
        <DetailContainer>
          <Detail></Detail>
        </DetailContainer>
      </DetailDiv>
    </Container>
  );
};

export default Product;
